import React, { Component } from "react";
import TeamUserAvatar from './TeamUserAvatar'
import { Header, Image } from "semantic-ui-react";

export default class TeamSearch extends Component {
  render() {
    const { allUsers,  addMember } = this.props;
    const mappedSearch = allUsers.map(user => <TeamUserAvatar user={user} addMember={addMember}/>)
    return (
      <div>
        {mappedSearch}
      </div>
    );
  }
}
